import React from 'react';
import CloseIcon from '@material-ui/icons/Close';
import "./Attendance.css";

function Attendance({setTrig}) {
    return (
        <div className="cw">
            
            <CloseIcon className="profile__back" onClick={() => setTrig(false)} />
            
            <div className="cw__container" style={{display: "flex", justifyContent: "center", width: "40vw"}}>
                <div className="att__content">
                    <h2 >Worker Name</h2>
                    <h3>Present days</h3>
                    <input type="number" className="cw__inp" />
                    <h3>OT Hours</h3>
                    <input type="number" className="cw__inp" />
                    
                </div>

            </div>
        </div>
    )
}

export default Attendance
